import { Handle, Position } from 'reactflow';
import { useState } from 'react';
import { useStore } from '../store';

const GenericNode = ({
  title,
  children,
  className = '',
  inputHandles = [],
  outputHandles = [],
  style = {},
  nodeId
}) => {
  const [showTemplateDialog, setShowTemplateDialog] = useState(false);
  const [templateName, setTemplateName] = useState('');
  const saveNodeTemplate = useStore((s) => s.saveNodeTemplate);

  const handleSaveTemplate = () => {
    if (templateName.trim() && nodeId) {
      saveNodeTemplate(nodeId, templateName.trim());
      setShowTemplateDialog(false);
      setTemplateName('');
    }
  };

  return (
    <div className={`node ${className}`} style={style}>
      <div className="node-header">
        <h4>{title}</h4>
        <button
          onClick={() => setShowTemplateDialog(true)}
          className="save-template-btn"
          title="Save as template"
        >
          ðŸ’¾
        </button>
      </div>
      {children}
      {inputHandles.map((handle, index) => (
        <Handle
          key={`input-${index}`}
          type="target"
          position={Position.Left}
          id={handle.id}
          style={{
            top: handle.top,
            background: '#555',
            width: '8px',
            height: '8px',
            border: '2px solid #fff'
          }}
        />
      ))}
      {outputHandles.map((handle, index) => (
        <Handle
          key={`output-${index}`}
          type="source"
          position={Position.Right}
          id={handle.id}
          style={{
            top: handle.top,
            background: '#555',
            width: '8px',
            height: '8px',
            border: '2px solid #fff'
          }}
        />
      ))}
      {showTemplateDialog && (
        <div className="template-dialog-overlay">
          <div className="template-dialog">
            <h5>Save as Template</h5>
            <input
              type="text"
              placeholder="Template name"
              value={templateName}
              onChange={(e) => setTemplateName(e.target.value)}
              onKeyDown={(e) => {
                if (e.key === 'Enter') handleSaveTemplate();
                if (e.key === 'Escape') setShowTemplateDialog(false);
              }}
              autoFocus
            />
            <div className="template-dialog-buttons">
              <button onClick={handleSaveTemplate}>Save</button>
              <button onClick={() => setShowTemplateDialog(false)}>Cancel</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default GenericNode;
